import styled from '@emotion/styled';

export const StyledButton = styled.button`
  height: 30px;
  color: #fff;
  font-size: 14px;
  font-weight: 600;
  line-height: 20px;
  background-color: #0d8ade;
  border-radius: 3px;
  cursor: pointer;
  outline: 0;
  border: 0;

  &:hover {
    background-color: #1398f1;
  }

  &:active {
    background-color: #0d8ade;
    outline: 0;
  }
`;
